import logo from './logo.svg';
import './App.css';

class App extends Component{
  conversion=(edad)=>{
    return edad*12;
  }
  render(){
    const edad=18;
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Ejemplo #5
        </p>
      </header>
      <Fragment>
        <h1>{edad}</h1>
        <h1>{this.conversion(edad)} meses</h1>

      </Fragment>
    </div>

  )};
}

export default App;
